import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { Provider, useSelector } from "react-redux";
import store from "./redux/store";
import Header from "./components/Header/Header";
import Loader from "./components/Loader/Loader";
import Modal from "./components/Modal/Modal";
import Navigation from "./components/Navigation/Navigation";
import HomePage from "./pages/HomePage/HomePage";
import LoginPage from "./pages/Login/Login";
import RegistrationPage from "./pages/Register/Register";
import DiaryPage from "./pages/DiaryPage/DiaryPage";
import CalculatorPage from "./pages/CalculatorPage/CalculatorPage";
import { AuthProvider } from "./redux/authContext";

const PrivateRoute = ({ element }) => {
    const { isAuthenticated } = useSelector((state) => state.user);
    return isAuthenticated ? element : <Navigate to="/login" replace />;
};

function App() {
    return (
        <Provider store={store}>
            <AuthProvider>
                <Router>
                    <Loader />
                    <Modal />
                    <HomePage />
                    <Routes>
                        <Route path="/" element={<HomePage />} />
                        <Route path="/login" element={<LoginPage />} />
                        <Route path="/register" element={<RegistrationPage />} />
                        <Route path="/diary" element={<PrivateRoute element={<AuthLayout><DiaryPage /></AuthLayout>} />} />
                        <Route path="/calculator" element={<PrivateRoute element={<AuthLayout><CalculatorPage /></AuthLayout>} />} />
                    </Routes>
                </Router>
            </AuthProvider>
        </Provider>
    );
}

export default App;
